// Mybooking.js
import React, { useEffect, useState } from "react";
import { Col, Container, Row } from "reactstrap";
import CommonSection from "../components/Shared/CommonSection";
import Tourcard from "../components/Shared/Tourcard";
import Searchbar from "../components/Shared/Searchbar/Searchbar";
import Newsletter from "../components/Shared/Newsletter";
import useFetch from "../hooks/useFetch";
import { BASE_URL } from "../Utilis/config";

const Mybooking = () => {
  
  const [books, setBooks] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchBookings = async () => {
      setLoading(true);
      try {
        const res = await fetch(`${BASE_URL}/booking/getAllBooking`);
        if (!res.ok) {
          throw new Error("Failed to fetch bookings");
        }
        const data = await res.json();
        setBooks(data);
      } catch (error) {
        setError(error.message);
      } finally {
        setLoading(false);
      }
    };

    fetchBookings();
  }, []);

  return (
    <>
      <CommonSection title={"All Bookings"} />
      <section>
        <Container>
          <Row>
            <div className="search-bar">
              <Searchbar />
            </div>
          </Row>
        </Container>
      </section>
      <section className="pt-0">
        <Container>
          {loading && <h4 className="text-center pt-05">Loading....</h4>}
          {error && <h4 className="text-center pt-05">{error}</h4>}
          {!loading && !error && (
            <Row>
              {books.map((book) => (
                <Col lg="3" className="mb-4" key={book.id}>
                  <Tourcard book={book} />
                </Col>
              ))}
            </Row>
          )}
        </Container>
      </section>
      <div className="nz">
        <Newsletter />
      </div>
    </>
  );
};

export default Mybooking;
